import React from 'react';
import styled from 'styled-components';

const GridLarge = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  /* background-image: linear-gradient(to right, transparent 99.5px, black 0.5px),
    linear-gradient(to bottom, transparent 99.5px, black 0.5px);
  background-size: 100px 100px; */

  background-image: linear-gradient(to right, transparent 49.5px, black 0.5px),
    linear-gradient(to bottom, transparent 49.5px, black 0.5px);
  background-size: 50px 50px;

  background-repeat: repeat;
`;

export default function GuideLine() {
  return (
    <>
      <LargeGrid />
    </>
  );
}
